import { useEffect, useRef, useState } from "react"; // Importamos 'useState'
import {
  BarChart,
  Bar,
  XAxis,
  YAxis,
  Tooltip,
  Legend,
  ResponsiveContainer,
  CartesianGrid,
  // Importação para o PieChart caso queira usá-lo para o total:
  // PieChart,
  // Pie,
  // Cell,
} from "recharts";

export default function GraficoMortalidade() {
  const ref = useRef(null);
  
  // 1. Estado para controlar qual visualização está ativa
  const [visao, setVisao] = useState("total"); // Pode ser 'total' ou 'mensal'

  // Dados para a visualização MENSAL
  const dadosMensal = [
    { mes: "Jan", Feminino: 31166, Masculino: 33635, Ignorado: 5 },
    { mes: "Fev", Feminino: 28526, Masculino: 31540, Ignorado: 2 },
    { mes: "Mar", Feminino: 32799, Masculino: 36295, Ignorado: 2 },
    { mes: "Abr", Feminino: 33055, Masculino: 36204, Ignorado: 1 },
    { mes: "Mai", Feminino: 35158, Masculino: 37396, Ignorado: 5 },
    { mes: "Jun", Feminino: 34076, Masculino: 36534, Ignorado: 9 },
    { mes: "Jul", Feminino: 35152, Masculino: 38039, Ignorado: 2 },
    { mes: "Ago", Feminino: 34812, Masculino: 36872, Ignorado: 7 },
    { mes: "Set", Feminino: 32622, Masculino: 34412, Ignorado: 5 },
    { mes: "Out", Feminino: 32074, Masculino: 34137, Ignorado: 5 },
    { mes: "Nov", Feminino: 30461, Masculino: 32691, Ignorado: 5 },
    { mes: "Dez", Feminino: 31382, Masculino: 33484, Ignorado: 5 },
  ];

  // Dados para a visualização TOTAL
  // Colocamos os totais em um array para que o BarChart funcione
  const dadosTotal = [
    {
      categoria: "Total Geral",
      Feminino: 394083,
      Masculino: 421239,
      Ignorado: 53,
    },
  ];
  
  // Função para alternar o estado da visualização
  const toggleVisao = () => {
    setVisao(visao === "total" ? "mensal" : "total");
  };

  useEffect(() => {
    const observer = new IntersectionObserver(
      entries => {
        entries.forEach(entry => {
          if (entry.isIntersecting) {
            entry.target.classList.add("visible");
          }
        });
      },
      { threshold: 0.3 }
    );

    if (ref.current) observer.observe(ref.current);
  }, []);

  // 2. Renderização do Gráfico com base no estado 'visao'
  const renderizarGrafico = () => {
    const data = visao === "total" ? dadosTotal : dadosMensal;
    const dataKeyX = visao === "total" ? "categoria" : "mes";

    return (
      <ResponsiveContainer width="100%" height={300}>
        <BarChart data={data} margin={{ top: 20, right: 30, left: 20, bottom: 5 }}>
          <CartesianGrid strokeDasharray="3 3" stroke="#ccc" />
          <XAxis dataKey={dataKeyX} tick={{ fill: "#fff", fontSize: 12 }} />
          <YAxis tick={{ fill: "#fff", fontSize: 12 }} />
          <Tooltip 
            formatter={(value, name, props) => {
              if (name === 'Ignorado') {
                return [value.toLocaleString('pt-BR'), 'Outros/Ignorado'];
              }
              return [value.toLocaleString('pt-BR'), name];
            }}
          />
          <Legend />
          <Bar dataKey="Feminino" fill="#ff7f0e" name="Feminino" />
          <Bar dataKey="Masculino" fill="#1f77b4" name="Masculino" />
          {/* Ignorado será menos visível por ter valores pequenos em comparação */}
          <Bar dataKey="Ignorado" fill="#8884d8" name="Outros/Ignorado" />
        </BarChart>
      </ResponsiveContainer>
    );
  };

  return (
    <div ref={ref} className="grafico-container fade-in">
      {/* Título dinâmico */}
      <h2>
        {visao === "total"
          ? "Distribuição Total de Casos por Gênero no Brasil"
          : "Distribuição Mensal de Casos por Gênero no Brasil"}
      </h2>
      <p>(Total Geral: 815.375)</p>

      {renderizarGrafico()}

      {/* 3. Botão para alternar a visualização */}
      <button 
        onClick={toggleVisao}
        style={{
          marginTop: '20px',
          padding: '10px 15px',
          backgroundColor: '#00aaff',
          color: 'white',
          border: 'none',
          borderRadius: '5px',
          cursor: 'pointer',
          fontSize: '16px',
        }}
      >
        {visao === "total" ? "Ver Distribuição Mensal" : "Ver Totais Consolidados"}
      </button>

      {/* Adicione estilos básicos de botão se necessário no seu CSS global */}
      {/* Exemplo: .grafico-container button:hover { background-color: #007bbd; } */}
    </div>
  );
}
